INSERT INTO `as` (`uid`, `category`, `question`, `answer`) VALUES
	(1, 1, 'A/S 비용안내', '<p>키보드의 고장 원인 및 고장 상태에 따라 발생하는 비용이 상이하기 때문에 고장 원인 파악 전까지 금액 안내를 드리기 어렵습니다.</p>'),
	(2, 1, 'A/S 정책 및 운영 방침', '<p>본 약관은 레오폴드㈜에서 판매한 제품에 대하여 고객 여러분들께 더 나은 서비스를 제공하기 위해 작성되었으며 제공되는 서비스는 아래와 같습니다.</p><p>본 약관은 국내에서만 효력을 갖습니다.</p><p>본 약관은 레오폴드㈜에서 제조/유통/판매한 제품에 한하여 적용됩니다.</p>'),
	(3, 1, 'A/S 처리의 목적', '<p>본 약관은 레오폴드㈜에서 제공하는 모든 서비스의 이용 조건 및 제품 사용 중의 문제로 인한 책임 사항과 고객에게 공평한 서비스를 제공하여 신뢰도를 높이며</p><p>업무의 공정을 기함에 목적이 있습니다.</p>'),
	(4, 1, 'A/S 유의사항', '<p>무상 보증 기간(고객과실 제외)은 구매일로부터 1년으로, 공식 홈페이지 구매가 아닌 제품의 보증기간 증명을 원하시는 경우 영수증을 첨부하여 주시기 바랍니다.</p><p>무상 보증 기간 제품의 구매 내역 및 영수증 확인이 불가능할 경우 제품 S/N을 통하여 보증기간을 산출하며, 실제 구입일보다 보증기간이 단축될 수 있습니다.</p><p>보증기간 내 \'고객 과실\'이 없는 고장의 경우 발송 택배비가 발생하며, 제품 점검 및 수리 후 선불 택배로 출고 진행됩니다.</p><p>보증기간 내 ‘고객 과실건’ 또는 보증기간 외 고장 제품의 경우 왕복 택배비가 발생하며 제품 상태에 따라 수리비용이 발생할 수 있습니다.</p>'),
	(5, 2, 'A/S 접수 방법', '<p>*A/S 접수 시 A/S 게시판에 아래 필수항목을 작성해 주시기 바랍니다.</p><p>1. 성함</p><p>2. 연락처</p><p>3. 주소</p><p>4. Part No. / Serial No.</p><p>5. 제품의 고장증상 및 그 원인 (ex: 침수, 이물질 유입, 파손)</p>'),
	(6, 2, 'A/S 택배 발송 안내', '<p>수리를 위해 제품을 발송하는 경우, A/S 접수 글의 "댓글" 확인 후 편하신 택배사 이용하시어 선불 택배로 발송해주시기 바랍니다.</p>'),
	(7, 2, 'A/S 보내는 곳 주소', '<p>- 경기도 고양시 일산동구 하늘마을로 158, 대방 트리플라온 B동 306호 레오폴드㈜</p><p>- 고객센터 : 050-2020-1030</p>'),
	(8, 2, '내방 A/S 접수 안내', '<p>- 운영시간 : 평일 오전 10:00 ~ 오후 5:00</p><p>- 점심시간 : 오후 12:00~1:30</p><p>- 주말 및 공휴일 휴무</p><p><br/></p><p>가급적 월요일 방문은 지양하고 있으며, 방문 접수 시 홈페이지 A/S 접수 및 고객센터 연락 후 방문해주시기 바랍니다.</p><p>당일 현장 A/S는 지원하고 있지 않으며, A/S 제품 접수만 가능합니다.</p>');
