INSERT INTO `download` (`uid`, `title`, `content`, `write_date`, `download_category_uid`, `user_uid`) VALUES
	(1, 'FC650MDS firmware updater', '<p>안녕하세요  레오폴드 입니다.</p><p>FC650MDS 일부 제품의 키 입력 오류 증상에 대하여 개선된 펌웨어를 제공하는 프로그램 입니다.</p><p>파일 다운로드 및 압축 해제 후 아래 안내에 따라 진행 해주시면 되겠습니다.</p><p>추가로 발생되는 버그나 오류 등은 지속적으로 모니터링 및 피드백 받아 개선하겠습니다.</p><p>감사합니다.</p>', '2024-09-19 10:06:04', 1, 1),
	(2, '레오폴드 FC980C Manual', '<p>레오폴드 FC980C 정전용량 무접점 키보드의 매뉴얼 입니다.</p>', '2024-09-19 10:07:15', 2, 1),
	(3, 'FC660C Manual', '<p>레오폴드 FC660C 정전용량 무접점  매뉴얼 입니다.</p>', '2024-09-19 10:07:57', 2, 1),
	(4, 'FC660C (low noise) Manual', '<p>레오폴드 FC660C 저소음 모델 매뉴얼 입니다.</p>', '2024-09-19 10:08:28', 2, 1),
	(5, 'Realforce R2 Manual', '<p>리얼포스 R2 메뉴얼 입니다.</p>', '2024-09-19 10:09:06', 2, 1),
	(6, 'FC210TP Manual', '<p>레오폴드 FC210TP 매뉴얼 입니다.</p>', '2024-09-19 10:09:28', 2, 1),
	(7, 'FC650MDS Manual', '<p>레오폴드 FC650MDS 매뉴얼 입니다.</p>', '2024-09-19 10:09:52', 2, 1),
	(8, 'FC980M Manual', '<p>레오폴드 FC980M 매뉴얼 입니다.</p>', '2024-09-19 10:10:28', 2, 1),
	(9, 'FC660M Manual', '<p>레오폴드 FC660M 매뉴얼 입니다.</p>', '2024-09-19 10:10:58', 2, 1),
	(10, 'FC750R Manual', '<p>레오폴드 FC750R PD 매뉴얼입니다.</p><p>아래 첨부파일을 다운로드하여 사용해 주시기 바랍니다.</p>', '2024-09-19 10:11:39', 2, 1),
	(11, 'FC900R PD Manual', '<p>레오폴드 FC900R PD 매뉴얼입니다.</p>', '2024-09-19 10:12:03', 2, 1),
	(12, 'Realforce R3 BT Manual & Software Guide', '<p>리얼포스 R3 BT 매뉴얼 및 전용 소프트웨어 가이드 파일 입니다.</p><p>아래 링크 및 첨부파일을 확인해주세요.<p><p><br /></p><p>소프트웨어 가이드 : ﻿Realforce R3_Software Guide<p>', '2024-09-19 10:13:11', 2, 1),
	(13, '한영키 한자키 변환 파일', '<p>안녕하세요. 레오폴드입니다.</p><p>키보드 우측 Alt  Ctrl 버튼을 각각 한/영  한자로 사용해주는 레지스트리 입니다.</p><p>우측 Alt  Ctrl 로 각각 한/영  한자 변환이 가능합니다.</p>', '2024-09-19 10:14:00', 1, 1),
	(14, '키 테스트 프로그램', '<p>안녕하세요. 레오폴드입니다.</p><p>키가 정상 작동 여부를 확인할 수 있는 키 테스트 프로그램입니다.</p><p>간단한 설치 후 테스트를 진행해 주시기 바랍니다.</p>', '2024-09-19 10:14:44', 1, 1),
	(15, '자가진단', '<img src="https://leopold.co.kr/web/upload/NNEditor/20230831/EC9E90EAB080ECA784EB8BA8.jpg" alt="download" style={{ display: "block", margin: "30px auto" }} />', '2024-09-19 10:18:13', 3, 1),
	(16, '컴퓨터 블루투스 설정 및 드라이버 초기화 방법', '<p>안녕하세요 레오폴드입니다.</p><p>레오폴드 블루투스 모델의 페어링 연결 실행 중 오류 발생 시 컴퓨터에 연결된 블루투스 및 키보드 설정 초기화 방법입니다.</p>', '2024-09-19 10:19:04', 3, 1),
	(17, '레오폴드 블루투스 모델 Pincode 확인 불가 시 연결 방법 Windows 11.ver', '<p>안녕하세요.  레오폴드입니다.</p><p>레오폴드 블루투스 모델의 페어링 연결 실행 중 오류 발생 시 아래 순서를 참고 하셔서 재 연결을 진행 바랍니다.</p>', '2024-09-19 10:19:51', 3, 1),
	(18, '리얼포스 소프트웨어 프로그램', '<p>리얼포스 소프트웨어 프로그램 다운로드 바로가기</p>', '2024-09-19 10:20:19', 1, 1),
	(19, 'FC730MBT MX2A Manual', '<p>레오폴드 FC730MBT MX2A 매뉴얼입니다.</p>', '2024-09-19 10:20:45', 2, 1);
