INSERT INTO `faq` (`uid`, `question`, `answer`, `image_url`, `faq_category_uid`) VALUES
	(1, '주문 내역을 변경할 수 있나요?', '<p>결제 완료된 주문 건은 직접 변경이 불가능합니다.</p><p>변경을 원하실 경우 1:1 문의게시판을 이용하시거나, 고객센터로 연락 바랍니다.</p>', NULL, 1),
	(2, '결제수단을 변경할 수 있나요?', '<p>죄송하지만, 결제 완료된 주문 건은 변경이 불가능합니다.</p><p>주문 취소 후, 재주문 부탁드립니다.</p>', NULL, 1),
	(3, '배송 가능 지역 및 배송비를 알고 싶어요', '<p>전국 모든 지역 배송이 가능하며, 배송비는 지역 구분 없이 3,000원 입니다. (20만원 이상 결제 시 무료배송)</p><p>위 내용은 우체국 사정에 따라 변동 될 수 있습니다.</p>', NULL, 1),
	(4, '배송지 변경이 가능한가요?', '<p>발송 전 주문 건에 한하여 배송지 변경이 가능합니다.</p><p>변경을 원하시는 경우, 1:1 문의 게시판을 이용하시거나, 고객센터로 연락 바랍니다.</p>', NULL, 1),
	(5, '해외배송이 가능한가요?', '<p>현재 레오폴드는 해외배송을 지원하지 않습니다.</p>', NULL, 1),
	(6, '퀵서비스로 주문 할 수 있나요?', '<p>영업시간 내 수도권 지역에 한하여 착불로 발송 가능하며, 지역별 배송비가 차등 적용됩니다.</p><p>퀵서비스 배송을 원하시는 고객님께서는 고객센터로 연락 바랍니다.</p>', NULL, 1),
	(7, '방문수령이 가능한가요?', '<p>영업시간 내 고객센터로 방문하여 수령 가능합니다.</p><p>반드시 방문 5분 전 고객센터로 연락 바랍니다.</p>', NULL, 1),
	(8, '신용카드 영수중, 거래명세서 등 거래증빙서류는 어디에서 확인할 수 있나요?', '<p>견적서는 장바구니 페이지에서 출력이 가능하며,</p><p>신용카드 매출전표 및 거래명세서는 주문완료 페이지에서 출력하실 수 있습니다.</p>', NULL, 1),
	(9, '제품을 잘못 구매했어요', '<p>주문 실수로 인한 교환은 단순 변심에 해당합니다.</p>', NULL, 2),
	(10, '교환/환불은 어떻게 하나요?', '<p>교환 및 반품 주소</p><p>- 경기도 고양시 일산동구 하늘마을로 158, 대방트리플라온 B동 306호</p><p><br /></p><p>교환 및 반품이 가능한 경우</p><p>- 제품에 이상이 있는 경우 수령일로부터 7일 이내 반품 및 환불이 가능합니다.</p><p>- 공급받으신 상품이 표시, 광고 내용과 다른 경우 수령일로부터 7일 이내 반품 및 환불이 가능합니다.</p>', NULL, 2),
	(11, '주문 취소했는데 신용카드 결제 취소는 언제 되나요?', '<p>카드 승인 취소 처리는 카드사 사정에 따라 영업일 기준 3~7일 소요될 수 있습니다.</p><p>자세한 내용은 해당 카드사에 문의 바랍니다.</p>', NULL, 2),
	(12, 'A/S 글 작성 후 댓글은 어디서 확인하나요?', '<p>마이페이지의 좌측 메뉴 중 [접수/문의 내역] 에서 조회 가능합니다.</p><p>아래 이미지 참고 부탁드립니다.</p>', 'https://leopold.co.kr/web/upload/NNEditor/20240612/20240612_114819_791.jpg', 3),
	(13, 'A/S 접수는 어떻게 하나요?', '<p>홈페이지 메인 홈 하단의 [A/S 접수]또는 고객지원 내  [A/S 접수]를 통하여 접수 가능합니다.</p>', NULL, 3),
	(14, '부품 및 구성품을 구매하고 싶어요.', '<p>아래 주문 가능한 품목을 확인하신 뒤 1:1 문의를 통하여 접수해 주시기 바랍니다.</p>', 'https://leopold.co.kr/web/upload/NNEditor/20231023/EBB680ED928820EAB080EAB2A9ED919C.jpg', 3),
	(15, '키보드에 물을 엎질렀어요', '<p>키보드를 분해하지 마시고 2~3일 건조 후 홈페이지 A/S 접수해 주시기 바랍니다.</p><p>침수의 경우 고객 과실로 분류되며, 무상 보증 기간 이내 이더라도 비용이 발생 될 수 있습니다.</p>', NULL, 3),
	(16, 'A/S 처리기간을 알고 싶어요.', '<p>입고일 기준 평균 1~2주 정도 소요되며, 키보드 상태 및 입고량에 따라 기간이 연장될 수 있습니다.</p>', NULL, 3),
	(17, '한/영키가 작동하지 않아요.', '<p>링크 내 첨부파일(레지스트리)을 설치 및 실행 후 PC를 재부팅 해주시면 한/영 전환 사용이 가능 합니다.</p>', NULL, 3),
	(18, 'PS2 단자가 인식되지 않아요.', '<p>[Win+R] →  [regedit] 검색 → [HKEY_LOCAL_MACHINE] → [SYSTEM] → [CurrentControlSet] → [Services] → [i8042prt]</p>', 'https://leopold.co.kr/web/upload/NNEditor/20240219/20240219_100051_185.jpg', 3),
	(19, '대량 구매를 하고 싶어요.', '<p>대량구매를 원하시는 경우  webmaster@leopold.co.kr 메일로 접수해 주시기 바랍니다.</p><p>메일로 접수 후 고객센터로 연락 주시면 더욱 빠른 처리가 가능합니다.</p>', NULL, 4);
