INSERT INTO `notice` (`uid`, `title`, `content`, `write_date`, `hit`, `image_url`, `user_uid`) VALUES
	(1, '레오폴드 홈페이지 리뉴얼 오픈 안내', '<p>안녕하세요. 레오폴드입니다.</p><p><br /></p><p>레오폴드의 홈페이지가 새로운 모습으로 단장했습니다.</p><p>고객 만족도 향상을 위해 더욱 노력하는 레오폴드가 되겠습니다.</p>', '2024-09-19 13:00:12', 0, NULL, 1),
	(2, '리얼포스 R3 재입고', '<p>입고 모델은 아래와 같습니다.</p><p>-R3 BT 블랙 저소음APC 영문 30g 균등</p><p>-R3TL BT 블랙 저소음APC 영문 30g 균등</p><p><br /></p><p>입고 수량이 많지 않은 점, 양해 부탁드립니다.</p>', '2024-09-19 13:01:13', 0, NULL, 1),
	(3, '추석 연휴 휴무 안내', '<p>안녕하세요. 레오폴드입니다.</p><p><br /></p><p>2023년 한가위를 맞이하여 추석 연휴 고객센터 휴무 안내 드립니다.</p><p>아래 일정 확인 부탁 드립니다.</p><p><br /></p><p>[휴무 일정]</p><p>2023년 09/27 (수) 오후 2:30 ~ 10/3 (화)</p>', '2024-09-19 13:03:00', 0, NULL, 1),
	(4, '레오폴드 신제품 출시 이벤트', '<p></p>', '2024-09-19 13:03:34', 0, 'https://leopold.co.kr/web/upload/NNEditor/20231113/EAB3B5ECA7804.jpg', 1),
	(5, '11월 신용카드 무이자 할부 안내', '<p></p>', '2024-09-19 13:04:27', 0, 'https://leopold.co.kr/web/upload/NNEditor/20231120/cardEvent.jpg', 1),
	(6, '리뷰 이벤트 당첨자 안내', '<p>MX2A 리뷰어로 선정되신 모든 분들, 당첨을 축하드립니다</p>', '2024-09-19 13:05:34', 0, 'https://leopold.co.kr/web/upload/NNEditor/20231128/copy-1701149099-ECA09CEBAAA9EC9D84-EC9E85EBA0A5ED95B4ECA3BCEC84B8EC9A94_-001.jpg', 1),
	(7, 'MX2A 코랄 블루 발송 지연 안내', '<p>안녕하세요. 레오폴드입니다.</p><p><br /></p><p>MX2A 코랄 블루 제품의 배송이</p><p>현재 운송사 사정으로 인하여 지연되었습니다.</p><p>기다리게 해드려 죄송합니다.</p>', '2024-09-19 13:07:06', 0, NULL, 1),
	(8, '12월 신용카드 무이자 할부 안내', '<p></p>', '2024-09-19 13:07:31', 0, 'https://leopold.co.kr/web/upload/NNEditor/20231211/cardEvent2028129.jpg', 1),
	(9, 'MX2A 키보드 신제품 출시 안내', '<p></p>', '2024-09-19 13:08:36', 0, 'https://leopold.co.kr/web/upload/NNEditor/20240305/MX2A20EC8BA0ECA09CED928820ECB69CEC8B9C.jpg', 1),
	(10, '키보드 러그 신제품 출시 기념 포토리뷰 이벤트', '<p></p>', '2024-09-19 13:09:15', 0, 'https://leopold.co.kr/web/upload/NNEditor/20240523/copy-1716439354-ED82A4EBB3B4EB939C20EB9FACEAB7B820EC9DB4EBB2A4ED8AB820EAB3B5ECA780EC82ACED95AD_ECB59CECA285.jpg', 1),
	(11, 'FC730MBT MX2A 코랄 블루 신제품 출시', '<p></p>', '2024-09-19 13:09:50', 0, 'https://leopold.co.kr/web/upload/NNEditor/20240711/73020MX2A20EC8BA0EAB79CECB69CEC8B9C20EAB3B5ECA780.jpg', 1),
	(12, '프리미엄 알파셀 장패드 신규 출시', '<p>프리미엄 알파셀 장패드가 신규 출시 되었습니다.</p>', '2024-09-19 13:10:26', 0, 'https://leopold.co.kr/web/upload/NNEditor/20240829/EC958CED8C8CEC858020EAB3B5ECA780.jpg', 1);
INSERT INTO `one2one` (`uid`, `title`, `content`, `write_date`, `delete_yn`, `delete_date`, `answer_yn`, `answer_date`, `answer`, `email`, `user_uid`) VALUES
	(1, '레오폴드 제품 중에 2.4 GHz 제품이 있나요?', '<p>블루투스나 유선 연결 제품 말고 2.4 GHz 연결 제품이 있나요?</p>', '2024-09-19 14:22:14', 'n', NULL, 'y', '2024-09-20 04:18:29', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>현재 판매 중인 제품에서 2.4GHz를 지원하는 제품은 없습니다.</p><br /><p>감사합니다.</p>', 'mosaek2@gmail.com', 2),
	(2, '리니어 5핀으로 변경 가능한가요?', '<p>5핀으로 커스텀이 가능한지 궁금해요..</p>', '2024-09-19 14:28:37', 'n', NULL, 'y', '2024-09-20 04:18:29', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>문의 주신 제품은 핫스왑 미지원 제품으로 스위치 교체가 불가능합니다.</p><br /><p>감사합니다.</p>', 'hitori@naver.com', 3),
	(3, '무상수리 문의', '<p>물을 쏟은 뒤 키보드 오작동 현상이 발생합니다. 무상수리 가능할까요?</p>', '2024-09-19 14:31:50', 'n', NULL, 'y', '2024-09-20 04:18:28', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>해당건은 유상 A/S로 진행됩니다.</p><br /><p>번거로우시겠지만 아래 경로로 AS접수 해주시면 담당부서에서 확인하여 처리 드리겠습니다.</p><br /><p>감사합니다.</p>', 'koala@naver.com', 4),
	(4, '키캡 교체해도 되나요?', '<p>키캡 바꿀려고 하는데 바꿔도 되는 제품인가요?</p>', '2024-09-19 14:34:34', 'n', NULL, 'y', '2024-09-20 04:18:27', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>해당 모델 키캡 교체 가능한 상품입니다.</p><br /><p>감사합니다.</p>', '', 5),
	(5, '갈축 재입고', '<p>갈축 품절인데 재입고 언제 될까요?</p>', '2024-09-19 14:36:55', 'n', NULL, 'y', '2024-09-20 04:18:27', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>재입고 예정 확인되었으나 일정은 확인이 어렵습니다.</p><br /><p>감사합니다.</p>', '', 6),
	(6, '아이패드에도 연결 가능한가요?', '<p>프로 3세대에 연결 가능할까요?</p>', '2024-09-19 14:38:19', 'n', NULL, 'y', '2024-09-20 04:18:26', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>윈도우, 맥 호환 가능합니다.</p><br /><p>감사합니다.</p>', '', 4),
	(7, '키캡 재질이 뭔가요?', '<p>키캡 재질이 뭔가요??</p>', '2024-09-19 14:39:48', 'n', NULL, 'y', '2024-09-20 04:18:24', '<p>안녕하세요 레오폴드 입니다.</p><p><br /></p><p>키캡 재질은 상세페이지에 설명되어있습니다.</p><br /><p>감사합니다.</p>', 'mijin@nate.com', 5),
	(8, '키 질문', '<p>한자키와 윈도우키는 어떤키로 사용하나요?</p>', '2024-09-19 14:41:16', 'n', NULL, 'n', NULL, NULL, '', 2),
	(9, '컴퓨터 본체와 연결할 때', '<p>컴퓨터 본체와 키보드 연결 시 usb c 타입 말고 연결하는 어댑터도 따로 있나요?</p>', '2024-09-19 14:42:14', 'n', NULL, 'n', NULL, NULL, '', 6);
