INSERT INTO `review` (`uid`, `title`, `content`, `write_date`, `video_url`, `notice_yn`, `delete_yn`, `delete_date`, `user_uid`) VALUES
	(1, '사용자 리뷰 안내', '<p>안녕하세요. 레오폴드 입니다 :)</p><p><br /></p><p>사용자 리뷰 게시판은 레오폴드의 상품 또는 서비스를 다른 분들께 공유 하거나 사용 후기를 남기는 공간입니다.</p><p>궁금하신 사항이나 문의 글은 1:1 문의 게시판을 통해 접수 부탁 드립니다.</p>', '2024-09-19 21:41:31', NULL, 'y', 'n', NULL, 1),
	(2, '레오폴드 FC750RBT MX2A 이 키보드 뭔가요? 강력 추천합니다.', '<p>앤프로2 게이트론 청축을 3년 정도 쓰다가 ‘ㅈ’ 키가 고장나서</p><p>여러 평을 써치하다가 레오폴드로 결정하고 공홈에서 텐키리스 중</p><p>가장 신제품으로 검색하여 새로 산 키보드가 레오폴드 FC750RBT mx2a 적축입니다.</p>', '2024-09-19 21:43:13', NULL, 'n', 'n', NULL, 3),
	(3, '속이 시원해지는 A/S 감사합니다.', '<p>A/S 기간이 한참이나 지나 버려서 A/S가 안될거라는 지레짐작에 겨우겨우 불편을 감수하면서 사용했었는데,</p><p>키보드 사용하는 시간이 더 늘어감에 따라 불편의 정도가 심해지는 탓에 유료라도 A/S를 맡기겠다고 결심을 했습니다.</p><p>1주일 정도의 시간을 기다리는데, 이쁜 레오폴드 박스에 친구가 깨끗하게 목욕까지 하고 들어 있었습니다.</p><p>이번 A/S를 담당해 주신 분들께..그리고 레오폴드 회사에 진심으로 감사하다는 말씀드리고 싶습니다.</p>', '2024-09-19 21:44:44', NULL, 'n', 'n', NULL, 4),
	(4, '블루투스 전환시 지연시간이 길어서 안좋습니다.', '<p>블루투스 기기 전환시 2초 이상을 누르고 있어야 하는게 너무 불편하네요.</p><p>이걸 왜 2초 이상 누르고 있어야 전환되게 한건지, 어차피 fn 키 조합인데 즉시 전화하면 안되는거였는지..</p><p>기기 전환할때마다 답답해 죽음...</p>', '2024-09-19 21:45:34', NULL, 'n', 'n', NULL, 6),
	(5, '레오폴드 키보드 무상수리', '<p>스페이스바의 고장과 방향키의 이물질 문제를 무상으로 수리해주셨습니다.</p><p>발송한 뒤 수리하고 다시 받는데까지 일주일도 걸리지 않았고 고장났던 부분이 다 고쳐져서 왔습니다.</p><p>고장난 뒤 심해졌던 스페이스바의 소음도 잡아주셔서 매우 만족스럽습니다.</p>', '2024-09-19 21:49:49', NULL, 'n', 'n', NULL, 5),
	(6, '리얼포스 키캡 마감이 싸구려 같아요', '<p>10주년 리얼포스 사용하다가 집에서도 리얼포스 사용할려고 하나 더 구매했는데 키캡 마감이 너무 싸구려 같네요이거 불량도 아닌거죠?</p>', '2024-09-19 21:52:25', NULL, 'n', 'n', NULL, 2);
